import XCTest

@testable import CodingChallenges

class LongestSubstringTests: XCTestCase {

    // MARK: - Tests
    
    func test_longestSubstringA() {
        let s = "abcabcbb"
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
    func test_longestSubstringB() {
        let s = "bbbbb"
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(1, longest)
    }
    
    func test_longestSubstringC() {
        let s = "pwwkew"
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
    func test_longestSubstringD() {
        let s = " "
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(1, longest)
    }
    
    func test_longestSubstringE() {
        let s = "abcde"
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(5, longest)
    }
    
    func test_longestSubstringF() {
        let s = ""
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(0, longest)
    }
    
    func test_longestSubstringG() {
        let s = "dvdf"
        
        let longest = LongestSubstring.lengthOfLongestSubstring(s)
        
        XCTAssertEqual(3, longest)
    }
    
